    {
        var assets = animation.spriteSheets.slice();

        for(var i in animation.data)
        {
            var mc = animation.data[i];
            if(mc.isImage)
            {
                assets.push(ASSET_URL + mc.view);
            }
        }    

        return assets;
    }

